import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Dashboard from './pages/Dashboard';

// Placeholder components for routes that haven't been implemented yet
const LivePage = () => <div>Live Matches Page (Coming Soon)</div>;
const UpcomingPage = () => <div>Upcoming Matches Page (Coming Soon)</div>;
const HistoryPage = () => <div>History Page (Coming Soon)</div>;
const StatisticsPage = () => <div>Statistics Page (Coming Soon)</div>;
const SettingsPage = () => <div>Settings Page (Coming Soon)</div>;

const App: React.FC = () => {
  return (
    <Routes>
      <Route path="/" element={<Dashboard />} />
      <Route path="/live" element={<LivePage />} />
      <Route path="/upcoming" element={<UpcomingPage />} />
      <Route path="/history" element={<HistoryPage />} />
      <Route path="/statistics" element={<StatisticsPage />} />
      <Route path="/settings" element={<SettingsPage />} />
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
};

export default App;
